import React, { Component } from 'react';
import { Container, Row, Col } from 'react-grid-system';

// Components
import Filter from '../components/Filter';
import Feed from '../components/Feed';

export default class Jobs extends Component {
  state = {
  }

  render () {
      return (
        <Container>
          <Row>
            <Col xl={3} lg={4}>
              <Filter />
            </Col>
            <Col xl={9} lg={8}>
              <Feed />
            </Col>
          </Row>
        </Container>
      )
   }
}
